import React from 'react'
import {Link} from 'react-router-dom';
import "./Navigation.css";
const Navigation = () => {

    const brandstyle={
        color: '#fff',
        textDecoration: 'none',
        fontWeight: 'bold',
        fontSize: '22px',
        display: 'flex',
        alignitems: 'center',
    }

    const logoText={
        marginLeft: '10px',
    }

    return (
        <nav className= "logoStyle container">
            <Link style={brandstyle} to="/">
                <img src="/images/logo.png" alt="logo"/>
                <span style={logoText}>Smit's Coding House</span>
            </Link>
        </nav> 
    )
}

export default Navigation
